$( document ).ready(function() {
  if($('.countdown').length > 0) {
    var countdownEl = $('.countdown');
    var date = countdownEl.data('countdown');
    var countDownDate = new Date(date).getTime();

    function addZero(nr) {
      if (nr < 10) {
        return '0' + nr;
      } else {
        return nr;
      }
    }

    function setCircleValue($element, value) {
      $left = $element.find('.countdown-item-value-border-left span')
      $right = $element.find('.countdown-item-value-border-right span')
      if (value < 50) {
        $right.css({'transform' : 'rotate(' + (value / 100 * 360) + 'deg)'});
        $left.css({'transform' : 'rotate(0)'});
      } else {
        $right.css({'transform' : 'rotate(180deg)'});
        $left.css({'transform' : 'rotate(' + (value / 100 * 360 - 180) + 'deg)'});
      }
    }

    // Update the count down every 1 second
    var x = setInterval(function() {

      // Get today's date and time
      var now = new Date().getTime();

      // Find the distance between now and the count down date
      var distance = countDownDate - now;

      // Time calculations for days, hours, minutes and seconds
      var days = Math.floor(distance / (1000 * 60 * 60 * 24));
      var hours = Math.floor((distance % (1000 * 60 * 60 * 24)) / (1000 * 60 * 60));
      var minutes = Math.floor((distance % (1000 * 60 * 60)) / (1000 * 60));
      var seconds = Math.floor((distance % (1000 * 60)) / 1000);

      // Display the result in the element with id="demo"
      $('.countdown-item-value-nr-days').html(addZero(days));
      setCircleValue($('.countdown-item-value-days'), (30 - days)/30 * 100);

      $('.countdown-item-value-nr-hours').html(addZero(hours));
      setCircleValue($('.countdown-item-value-hours'), (24 - hours)/24 * 100);

      $('.countdown-item-value-nr-minutes').html(addZero(minutes));
      setCircleValue($('.countdown-item-value-minutes'), (60 - minutes)/60 * 100);

      $('.countdown-item-value-nr-seconds').html(addZero(seconds));
     setCircleValue($('.countdown-item-value-seconds'), (60 - seconds)/60 * 100);

      // If the count down is finished, write some text
      if (distance < 0) {
        clearInterval(x);
        $('.article-header-online-course-container').removeClass('hidden');
        $('.article-header-online-course-container-countdown').addClass('hidden');
      }
    }, 1000);


  }
});

$( document ).ready(function() {

  $('.page-footer-newsletter-form').submit(function( event ) {
    var $form = $(this);
    var url = $form.attr('action');
    $('.form-feedback', $form).remove();

    $.ajax({
      type: "GET",
      url: url,
      data: $form.serialize()
    }).done(function(response) {
      if(response.status == 'ok') {
        $ok = $('<span class="has-success form-feedback">' + response.message + '</span>');
        $form.append($ok);
      } else {
        $error = $('<span class="has-error form-feedback">' + response.message + '</span>');
        $form.append($error);
      }
    })
    .fail(function() {
      $error = $('<span class="has-error form-feedback">Error</span>');
      $form.append($error);
    });

    return false;
  });

});

$( document ).ready(function() {
  function loadPrivatePlacementRecord() {
    var url = $('.private-placement-record-body-table').data('url');
    var timeout = $('.private-placement-record-body-table').data('timeout');

    $.ajax({
      type: "GET",
      url: url
    }).done(function(response) {
      var list = response.txs;
      $tbody = $('<tbody></tbody>');
      for (var i=0;i<list.length;i++) {
        var date = new Date(list[i].timestamp* 1000);
        var dateString = date.getFullYear() + '-' + String(date.getMonth() + 1).padStart(2, '0') + '-'  + String(date.getDate()).padStart(2, '0') + ' ' + date.getHours() + ':' + date.getMinutes();
        var hash = list[i].tx_hash.substring(0, 15) + '...' +  list[i].tx_hash.substring(list[i].tx_hash.length - 15);
        var $tr = $('<tr>' +
          '<td>' + dateString + '</td>' +
          '<td>' + list[i].send_eth_value + '</td>' +
          '<td>' + list[i].receive_mini_amount + '</td>' +
          '<td>' + list[i].fee + '</td>' +
          '<td><span class="text-primary">' + hash + '</span></td>' +
          '<td><span class="' + list[i].status + '">' + list[i].status + '</span></td>' +
        '</tr>');
        $tbody.append($tr);
      }

      $('.private-placement-record-body-table tbody').remove();
      $('.private-placement-record-body-table').append($tbody);
      $('.private-placement-record-body-loading').addClass('hidden');
      $('.private-placement-record-body-table').addClass('show');
      var page = $('.private-placement-record-body-table').attr('data-page');

      paginator({
        page: page,
        table: $('.private-placement-record-body-table')[0],
        box: $('.private-placement-record-body-pagination')[0],
        active_class: "active"
      });


      setTimeout(function(){
        loadPrivatePlacementRecord();
      }, timeout);
    })
    .fail(function(response) {
      setTimeout(function(){
        loadPrivatePlacementRecord();
      }, timeout);
    });

  }

  if($('.private-placement-record-body-table').length > 0) {
    loadPrivatePlacementRecord();
  };

});

$( document ).ready(function() {
  var privatePlacementConfig = null;

  function loadPrivatePlacement() {
    var urlData = $('.private-placement-exchange-graph').data('data');
    var timeout = $('.private-placement-exchange-graph').data('timeout');

    $.ajax({
      type: "GET",
      url: urlData
    }).done(function(response) {

      var ratio = privatePlacementConfig[response.round - 1].ratio;
      $('.private-placement-exchange-header-ratio-swap').html(ratio);

      $('.private-placement-exchange-subheader-value').html(response.remaining_mini);

      var activeRound = privatePlacementConfig.length - response.round + 1;
      var firstLine = response.round - 1;
      var lastLine = privatePlacementConfig.length;

      if(activeRound > 10) {
        var lastLine = response.round - 1 + 8;
      }

      $content = $('<div class="private-placement-exchange-graph-content"></div>');
      for (var i = firstLine ; i < lastLine; i++) {
        var $line = $('<div class="private-placement-exchange-graph-line"><div class="private-placement-exchange-graph-line-value"><span>' + privatePlacementConfig[i].ethValue + 'ETH=' + (privatePlacementConfig[i].miniAmount) + 'MINI</span></div></div>');
        $content.append($line);
      }

      if(activeRound > 10) {
        var $line = $('<div class="private-placement-exchange-graph-line"><div class="private-placement-exchange-graph-line-value"><span>..........</span></div></div>');
        $content.append($line);
        var $line = $('<div class="private-placement-exchange-graph-line"><div class="private-placement-exchange-graph-line-value"><span>' + privatePlacementConfig[privatePlacementConfig.length - 1].ethValue + 'ETH=' + privatePlacementConfig[privatePlacementConfig.length - 1].miniAmount + 'MINI</span></div></div>');
        $content.append($line);
      }

      $('.private-placement-exchange-graph-content').remove();
      $('.private-placement-exchange-graph').append($content);

      var $remaining = $('<i class="private-placement-exchange-graph-line-value-remaining ' + (response.remaining_ration  < 20 ? 'right-text' : '') + '" style="width: ' + response.remaining_ration + '%"><span>' + response.remaining_ration + '%' + '</span></i>')
      $('.private-placement-exchange-graph-line:first-child .private-placement-exchange-graph-line-value').append($remaining);

      $('.private-placement-exchange-loading').addClass('hidden');
      $('.private-placement-exchange').addClass('show');

      setTimeout(function(){
        loadPrivatePlacement();
      }, timeout);
    });
  }

  if($('.private-placement-exchange-graph').length > 0) {
    var urlConfig = $('.private-placement-exchange-graph').data('config');
    $.ajax({
      type: "GET",
      url: urlConfig
    }).done(function(response) {
      privatePlacementConfig = response.Configs;
      loadPrivatePlacement();
    });
  };

});

